import Card from "./Card";
import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";
function Expenses(props) {
  return (
    <Card className="expenses">
      {props.expenses.map((item) => {
        return (
          <>
            <ExpenseItem
              date={item.date}
              title={item.title}
              amount={item.amount}
            />
          </>
        );
      })}
    </Card>
  );
}
export default Expenses;
